import React, { Component } from "react";
import { getWorshippers } from "../common/fakeWorshippers";

class Dashboard extends Component {
  state = {
    worshippers: getWorshippers(),
  };
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <div>
            <h2>DashBoard</h2>
            <p>Showing number of bookings</p>
            <table className="table">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Phone Number</th>
                  <th>Email</th>
                  <th>Service</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {this.state.worshippers.map((worshipper) => (
                  <tr key={worshipper._id}>
                    <td>
                      {worshipper.FirstName} {worshipper.LastName}
                    </td>
                    <td>{worshipper.PhoneNumber}</td>
                    <td>{worshipper.Email}</td>
                    <td>{worshipper.service.name}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </main>
      </React.Fragment>
    );
  }
}

export default Dashboard;
